import React, {Component} from 'react'
import {Button} from 'reactstrap'

class CuerpoFeedBox extends React.Component{
  render(){
    const { embedUrl,thumb } = this.props
    return (
      <div>
          <p> {embedUrl} </p>
          <img src={thumb} className="img-user"/>
    </div>
    )
  }
}

export default CuerpoFeedBox
